import React, { useState } from "react";
// import { v4 as uuidv4 } from "uuid";
import "../NoteList/NoteList.scss";

function NoteList({ videos }) {
  return (
    <>
      <div className="note__list">
        {videos.map((note) => (
          <p id={note.id} text={note.text} />
        ))}
      </div>
      <div className="note__list">
        {notes.map((note) => (
          <p id={note.id} text={note.text} />
        ))}
      </div>
    </>
  );
}

export default NoteList;
